import styled from 'styled-components';

export const StyledButton = styled.button`
  color: #ffffff;
  background-color: #314F7C;
  padding: 15px 50px;
  border: none;
  border-radius: 10px;
  opacity: 60%;
  margin: 5px;
`

export default StyledButton;
